import React from 'react'
import { Form, Container, Grid } from 'semantic-ui-react'

const Goal = props => {
  return (
    <div class='ui grid'>
      <div class='three wide column'><h4>Goal Date:</h4> {props.goal.goalDate}</div>
      <div class='three wide column'><h4>Bedtime Target:</h4> {props.goal.bedtimeTarget}</div>
      <div class='three wide column'><h4>Wakeup Time Target:</h4> {props.goal.wakeupTarget}</div>
    </div>
  )
}

export default Goal
